  true,\n\t\"url\": null,\n\t\"notes\": \"One of the key components of NASAs Earth
  Science Research Strategy to better understand the complex nature of Earths climate
  is the determination of the global radiation balance. Comprehensive regional-to-global
  climate models (R/GCM) are playing an ever-greater role in addressing this issue.
  Because of their important role in modifying the radiative energy balance, the characteristics
  of aerosols, especially near their sources and sinks, are essential parameters to
  the R/GCMs. Many EOS era instruments (e.g., SeaWiFS, MODIS, MISR, etc.) are designed
  to provide such information with a high degree of fidelity. A README can be found
  at ftp://measures.gsfc.nasa.gov/data/s4pa/DeepBlueSeaWiFS_Level2/SWDB_L2.003/doc/README.DeepBlueSeaWiFS.pdfnnParameters
  contained in the data files include the following:nnVariable Name | Description
  |Unitsnaerosol_optical_thickness_550_land | aerosol optical thickness estimated
  at 550 nm over land | (1)naerosol_optical_thickness_550_land_ocean | aerosol optical
  thickness estimated at 550 nm over land and ocean | (1)naerosol_optical_thickness_550_land_ocean_best_estimate
  | best estimate of aerosol optical thickness estimated at 550 nm over land and ocean
  \  | (1)naerosol_optical_thickness_550_ocean | aerosol optical thickness estimated
  at 550 nm over ocean | (1)naerosol_optical_thickness_confidence_flag_land | aerosol
  optical thickness confidence flag over land    | (1)naerosol_optical_thickness_confidence_flag_land_ocean
  | aerosol optical thickness confidence flag over land and ocean | (1)naerosol_optical_thickness_confidence_flag_ocean
  | aerosol optical thickness confidence flag over ocean | (1)naerosol_optical_thickness_land
  | aerosol optical thickness at 412 nm, 490 nm, and 670 nm over land  | (1)naerosol_optical_thickness_ocean
  | aerosol optical thickness at 412 nm, 490 nm, and 670 nm over ocean | (1)nangstrom_exponent_confidence_flag_land
  | angstrom exponent confidence flag over land | (1)nangstrom_exponent_confidence_flag_land_ocean
  | angstrom exponent confidence flag over land and ocean | (1)nangstrom_exponent_confidence_flag_ocean
  | angstrom exponent confidence flag over ocean | (1)nangstrom_exponent_land | angstrom
  exponent over land as derived from aerosol optical thickness at 412 nm and 490 nm
  \ | (1)nangstrom_exponent_land_ocean | angstrom exponent over land and ocean as
  derived from aerosol optical thickness at 412 nm and 490 nm  | (1)nangstrom_exponent_ocean
  | angstrom exponent over ocean as derived from aerosol optical thickness at 412
  nm and 490 nm  | (1)nnEnd of parameter information\",\n\t\"license_title\": \"U.S.
